import React from "react";
import "ExpenseForm.css";

function NewExpense(){
    return(
    <div cl>
        <form>
            <input type="name"></input>
            <input type="number"></input>
            <input type="date"></input>
        </form>
    </div>
    )
}
export default NewExpense;
